import React, { useState, useEffect } from "react";
//import { Link } from "react-router-dom";
//import imagenFondo from '../assets/images/mandalorian.jpg';

function LastMovieInDb(){
    const [product, setProduct] = useState();
    useEffect(() => {
        const getInfo = async () => {
          let resProduct = await fetch(`http://localhost:5001/api/products`);
          let productSaved = await resProduct.json();
         
          let lastProduct = productSaved.products.pop();
          console.log(lastProduct);
          setProduct(lastProduct);
        };
        getInfo();
      }, []);
    return(
        <div className="col-lg-6 mb-4">
            <div className="card shadow mb-4">
                <div className="card-header py-3">
                    <h5 className="m-0 font-weight-bold text-gray-800">{product.descripcion}</h5>
                </div>
                <div className="card-body">
                    <div className="text-center">
                        <img className="img-fluid px-3 px-sm-4 mt-3 mb-4" style={{width: 40 +'rem'}} 
                        src={`http://localhost:5001/images/products/${product.id}/${product.imagen}`}
                        alt=""/>
                    </div>
                    <p></p>
                    <a className="btn btn-danger" target="_blank" rel="nofollow" href="/">Ultimo</a>
                </div>
            </div>
        </div>
    )
}
export default LastMovieInDb;
